import './App.css';

function App() {
  return (
    <div className="App">
      <div className="conatiner mx-auto max-w-6xl text-center drop-shadow-lg text-gray-800">
        <h1 className="text-4xl">Expense Tracker</h1>
      </div>
    </div>
  );
}

export default App;
